import React from 'react'
import './item.css'

const item = (props) => {
  return (
    <div className='item'>
      <Linkt to={`/product/${props.id}`}><img src={props.image} alt="" /></Linkt>
      <p>{props.name}</p>
      <div className="item-price">
        <div className="item-price-new">
          ${props.new_price}
        </div>
        <div className="item-old-price">
          ${props.old_price}
        </div>
      </div>
    </div>
  )
}

export default item
